var request=new XMLHttpRequest();request.open("GET","assets/js/data/repos.json",false);request.send(null);var my_JSON_object=JSON.parse(request.responseText);my_JSON_object.forEach(function(a){console.log(a);$(".list").append("<li class='list__item'><div class='name'>"+a.name+"</div><div class='avatar'><img src='"+a.owner.avatar_url+"' alt=''></div><div class='repos_name'>"+a.owner.login+"</div><div class='repos_url'>"+a.owner.url+"</div></li>")});